UPDATE CURR_NBM FROM $$STGDB.WI_BKGS_ERP_SO_CURR_NBM CURR_NBM, ( SELECT DRVD_NCR_BKG_TRX_KEY , PROCESS_DATE FROM $$STGDB.WI_BKGS_ERP_SO_CURR_NBM CURR_NBM WHERE DV_SALES_ORDER_LINE_KEY NOT IN ( SELECT DV_SALES_ORDER_LINE_KEY FROM $$SLSORDVWDB.N_BOOKINGS_MEASURE WHERE BKGS_MEASURE_TRANS_TYPE_CODE = 'ERP' AND SUMMARY_QUOTE_FLG = 'Y' GROUP BY 1 ) AND CURR_NBM.FORWARD_REVERSE_CODE = 'R' AND CURR_NBM.SUMMARY_QUOTE_FLG = 'Y' AND CURR_NBM.CANCEL_CODE <> 'Lost Order' /* To handle scenario of debooking and booking processed with same process date */ UNION /*Below union part is to handle multiple net change process dates processed with single bookings process date*/ SELECT DRVD_NCR_BKG_TRX_KEY , PROCESS_DATE FROM $$STGDB.WI_BKGS_ERP_SO_CURR_NBM CURR_NBM WHERE DV_SALES_ORDER_LINE_KEY NOT IN ( SELECT DV_SALES_ORDER_LINE_KEY FROM $$SLSORDVWDB.N_BOOKINGS_MEASURE WHERE BKGS_MEASURE_TRANS_TYPE_CODE = 'ERP' AND SUMMARY_QUOTE_FLG = 'Y' GROUP BY 1 ) AND CURR_NBM.FORWARD_REVERSE_CODE = 'F' AND CURR_NBM.SUMMARY_QUOTE_FLG = 'Y' QUALIFY RANK() OVER( PARTITION BY DV_SALES_ORDER_LINE_KEY ORDER BY PROCESS_DATE DESC ) > 1 ) WI SET SUMMARY_QUOTE_FLG = 'N' WHERE CURR_NBM.DRVD_NCR_BKG_TRX_KEY = WI.DRVD_NCR_BKG_TRX_KEY AND CURR_NBM.PROCESS_DATE = WI.PROCESS_DATE ;
